import React, { useEffect, useState } from "react";
import Table from "./table";

function Home() {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Отправка запроса к API на бэкенде
    fetch("http://localhost:5000/api/data")
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setData(data); // Сохраняем полученные данные в стейт
      })
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  return (
    <div>
      <h2>Data Table</h2>
      <Table data={data} /> {/* Передаем данные в таблицу */}
    </div>
  );
}

export default Home;
